      bio: 'Lorem asdfasdfadsf',
      age: 40,
      isHappy: true
    },
    {
      id: 2,
      firstname: 'John',
      lastname: 'Doe',
      bio: 'Lorem asdfasdfadsf',
      age: 22,
      isHappy: false
    },
  ]
